import React,{useEffect,useReducer} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TablePagination from '@material-ui/core/TablePagination';
import TableRow from '@material-ui/core/TableRow';

const columns = [
  { id: 'countryRegion', label: 'Name', minWidth: 170 },
  { id: 'iso3', label: 'ISO\u00a0Code', minWidth: 100 },
  {
    id: 'provinceState',
    label: 'Province State',
    minWidth: 170,
    align: 'right',
    format: value => value.toLocaleString(),
  },
  {
    id: 'confirmed',
    label: 'Confirmed Case',
    minWidth: 170,
    align: 'right',
    format: value => value.toLocaleString(),
  },
  {
    id: 'recovered',
    label: 'Recovered Case',
    minWidth: 170,
    align: 'right',
    format: value => value.toFixed(2),
  },
  {
    id: 'deaths',
    label: 'Death Case',
    minWidth: 170,
    align: 'right',
    format: value => value.toFixed(2),
  },
];

function createData(countryRegion, iso3, provinceState, confirmed,recovered,deaths) {
  return { countryRegion, iso3, provinceState, confirmed,recovered,deaths };
}

const rows = [
  createData('India', 'IN', 1324171354, 3287263,1),
  createData('China', 'CN', 1403500365, 9596961,2),
  createData('Italy', 'IT', 60483973, 301340,3),
  createData('United States', 'US', 327167434, 9833520,4),
  createData('Canada', 'CA', 37602103, 9984670,5),
  createData('Australia', 'AU', 25475400, 7692024,6),
  createData('Germany', 'DE', 83019200, 357578,7),
  createData('Ireland', 'IE', 4857000, 70273,8),
  createData('Mexico', 'MX', 126577691, 1972550,9),
  createData('Japan', 'JP', 126317000, 377973,10),
  createData('France', 'FR', 67022000, 640679),
  createData('United Kingdom', 'GB', 67545757, 242495),
  createData('Russia', 'RU', 146793744, 17098246),
  createData('Nigeria', 'NG', 200962417, 923768),
  createData('Brazil', 'BR', 210147125, 8515767),
];

const useStyles = makeStyles({
  root: {
    width: '100%',
  },
  container: {
    maxHeight: 440,
  },
});

export default function StickyHeadTable(props) {
  const classes = useStyles();
  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(10);
  const [rowdata, setrowdata] =React.useState([])

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = event => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };
useEffect(()=>{
    let isSubscribed = true;
    let arr = []
    if (isSubscribed) {
        // console.log(props.data)
        if(props.data){
            props.data.map(element=>{
                setrowdata(prevData=>[...prevData,createData(element.countryRegion,element.iso3,element.provinceState,element.confirmed,element.recovered,element.deaths)])
            })
            // props.data.map(element=>{
            //     arr.push(createData(element.countryRegion,element.iso3,element.provinceState,element.confirmed,element.recovered,element.deaths))
            // })
        }
    }
    // console.log(arr)
    return () => {
      console.log("unmounted");
      isSubscribed = false;
    };
},[props])
console.log(rowdata)
  return (
    <Paper className={classes.root}>
      <TableContainer className={classes.container}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
            <TableRow>
              {columns.map(column => (
                <TableCell
                  key={column.id}
                  align={column.align}
                  style={{ minWidth: column.minWidth }}
                >
                  {column.label}
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {rowdata.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage).map(row => {
              return (
                <TableRow hover role="checkbox" tabIndex={-1} key={row.iso3}>
                  {columns.map(column => {
                    const value = row[column.id];
                    return (
                      <TableCell key={column.id} align={column.align}>
                        {value}
                        {/* {column.format && typeof value === 'number' ? column.format(value) : value} */}
                      </TableCell>
                    );
                  })}
                </TableRow>
              );
            })}
          </TableBody>
        </Table>
      </TableContainer>
      <TablePagination
        rowsPerPageOptions={[10, 25, 100]}
        component="div"
        count={rows.length}
        rowsPerPage={rowsPerPage}
        page={page}
        onChangePage={handleChangePage}
        onChangeRowsPerPage={handleChangeRowsPerPage}
      />
    </Paper>
  );
}
